$(".go-top").on("click", function (event) {
	event.preventDefault();
	var id = $(this).attr('href'),
		top = $(id).offset().top;
	$('body, html').animate({
		scrollTop: top
	}, 350);
});

$(window).scroll(function () {
	var offset = $('#main').offset();
	if ($(this).scrollTop() > offset.top) {
		$('.go-top').css('display', 'block');
	} else {
		$('.go-top').css('display', 'none');
	}
});


